import Vuex from 'vuex';
import storePluginBuilder from './appManagerPlugin';

export default {
    build(modules, appManager, Vue) {
        Vue.use(Vuex);
        let moduleNames = Object.keys(modules);
        if (moduleNames.indexOf('user') === -1) {
            console.warn('No user store module found');
        }
        return new Vuex.Store({
            modules: modules,
            plugins: [storePluginBuilder.build(appManager)]
        });
    }
};
